module.exports = async (link) => { const axios = require("axios"); const headers = { "User-Agent": "PostmanRuntime/7.31.1", "Content-Type": "application/json", "Accept-Encoding": "gzip, deflate, br", }, res = await axios.post( "https://igram.world/api/convert", { url: link }, { headers } ); try { return res.data; } catch (error) { return { error, response: res.data }; } };